#include <iostream>
#include <queue>
#include <string>
#include <vector>

int q,k;

std::priority_queue<int,std::vector<int>,std::greater<int>> que;
std::priority_queue<int,std::vector<int>> stock;

int main() {

    std::cin>>q>>k;

    std::string str;

    for(int i=0;i<q;++i){
        std::cin>>str;
        int n;
        if(str=="arrive"){
            std::cin>>n;
            if(que.size()<k)
                que.emplace(n);
            else if(n>que.top()){
                stock.emplace(que.top());
                que.pop();
                que.emplace(n);
            }
        }
        else{
            if(que.size()==k){
                std::cout<<que.top()<<std::endl;
                que.pop();
            }
            else
                std::cout<<"kawanai!"<<std::endl;
        }

        while(!stock.empty()&&que.size()<k){
            que.emplace(stock.top());
            stock.pop();
        }
    }



    return 0;
}
